import React from "react";
import "../../assets/css/login.css";
import "../../assets/css/bootstrap.min.css";
import logo from "../../assets/logo/jababeka_report.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAddressBook } from "@fortawesome/free-solid-svg-icons";

const Login = () => {
  return (
    <>
      <div className="square_login">
        <div className="line_logo">
          <img src={logo} height={10} width={10} />
          <h2 className="text_logo">Jababeka Report</h2>
        </div>
        <h1 className="text_login">Login</h1>

        <div className="form_login">
          <form>
            <div>
              <label for="exampleFormControlInput1" class="form-label">
                Username
              </label>

              <input
                type="text"
                class="form-control"
                id="exampleFormControlInput1"
                placeholder="Username"
              />
            </div>
          </form>
        </div>
      </div>
    </>
  );
};

export default Login;
